import React from "react";
import GoBack from "../components/GoBack";
import Header from "../components/Header";
import "./Invoice.css";

function Invoice() {
  return (
    <React.Fragment>
      <Header />
      <div className="page-container">
        <div className="page-container-2">
          <GoBack />
        </div>
      </div>
    </React.Fragment>
  );
}

export default Invoice;
